INSERT INTO `blogposts` (`id`, `name`, `date`, `image`, `content`) VALUES
(1, 'Android N - The Review', '2017-07-01', , '<b>Android Nougat has a few new, fresh options that you are gonna love. Top six new and improved options which makes Android Nougat so attractive and fun to play with are:</b><br/>\r\n\r\n1. Multi-window via Split-screen, in portrait and landscape mode. <br/>\r\n2. Quick app switching.<br/>\r\n3. Defaulted 5 toggles that are always present in Quick Settings menu.<br/>\r\n4. Dose Mode 2.0, new and improved.<br/>\r\n5. Smart notifications (direct response and grouping the notifications). <br/>\r\n6. Better and faster graphics performance.');
INSERT INTO `blogposts` (`id`, `name`, `date`, `image`, `content`) VALUES
(2, '<b>iPhone 8</b>: The latest News and Rumours.', '2017-07-26', , 'The biggest change we are expecting to see from the iPhone 8 is a huge ramping up of the handsets screen-to-body ratio.<br/>\r\nAnother is full-screen face with the virtual button built directly into the screen. Along with ifinity display.<br/>\r\nApple is expected to finally introduce OLED displays on the iPhone.\r\n Apple is also highly likely to introduce a new system-on-a-chip (SoC) for the iPhone 8, as is always the case with major iPhone releases. The iPhone 7 runs on the new A10 Fusion chip, but the iPhone 8 will utilise a newer SoC probably the unannounced A11 processor.<br/>\r\nThere are many more such speculations on the internet which has not been confirmed as of yet');
INSERT INTO `blogposts` (`id`, `name`, `date`, `image`, `content`) VALUES
(3, 'Google is working on a new operating system ', '2017-07-28', , 'You heard that right.<br/>\r\nSo what is Fuchsia for? There have been a number of suggestions. Some people think it could be used to <i>unify<i> Chrome OS and Android into a single operating system (a plan that was first rumored last year, with the new OS said to be scheduled for a 2017 release), while others say it could be used to power hardware like Google&#39;s OnHub router or third party Internet of Things devices.<br/>\r\nLooking into Fuchsia&#39;s code gives us a few clues. For example, the OS is built on Magenta, a medium-sized microkernel that is itself based on a project called LittleKernel, which is designed to be used in embedded systems (computers that have a specialized function and often don&#39;t need an actual operating system, like the software in a digital watch).<br/><br/>\r\nSimilarly, both of the developers listed on Fuchsia&#39;s GitHub page : Christopher Anderson and Brian Swetland are experts in embedded systems.\r\n');
INSERT INTO `blogposts` (`id`, `name`, `date`, `image`, `content`) VALUES
(4, 'Bitcoin has &#39;split&#39;', '2017-08-01', , 'Bitcoin has split in two, so you can have double the cryptocurrency.<br/>\r\nThe split, called a hard fork, comes out of a bitcoin group&#39;s desire to combat high transaction fees and a bitcoin size limit that made mining larger blocks invalid. \r\nThis has a nuanced implication for Bitcoin owners.<br/>\r\nIf you own Bitcoin and control your private keys, the same private keys can be used to spend your newly minted Bitcoin Cash.\r\nIf you own Bitcoin but don&#39;t control the keys, then it depends on whether you&#39;ve chosen to keep your bitcoins on a Bitcoin Cash-friendly platform or digital wallet. Each platform is treating the new Bitcoin Cash differently. To enjoy this extra currency, you should check with your platform and wallet to see what the company policy is.<br/>\r\nAs a prelude to the split, Bitcoin trading platforms like CEX.io suspended Bitcoin withdrawals beforehand. CEX.io will allow both cryptocurrencies and split the coins for its customers. CEX.io chief marketing officer Eugene Kovalyk says, &#39;&#39;Whether we will list Bitcoin Cash as a new trading pair depends on the demand. If demand is big we should consider adding it definitely...No one should lose Bitcoin Cash on our platform.&#39;&#39;');
INSERT INTO `blogposts` (`id`, `name`, `date`, `image`, `content`) VALUES
(5, 'Microsoft Paint 1985 to 2017', '2017-08-02', , 'Microsoft&#39;s next Windows 10 update, called the Autumn (or Fall in the US) Creators Update, will bring a variety of new features. But one long-standing stalwart of the Windows experience has been put on the chopping block: Microsoft Paint.<br/>\r\nWith the Windows 10 Creators Update, released in April, Microsoft introduced the new Paint 3D, which is installed alongside traditional Paint and features 3D image making tools as well as some basic 2D image editing. But it is not an update to original Paint and doesn&#39;t behave like it.');

